import React, { Component } from 'react';

class Dog extends Component {
    render() {
        return (
            <div className="contbox">
                <div className="dogimg"></div>
                <h1> 댕댕이집사 그룹</h1>
                <p>    
                    세젤예 댕댕이들 모여라~!
                </p>
            </div>
        );
    }
}

export default Dog;
